import React, { useState, useEffect } from 'react';
import { View, Text, FlatList } from 'react-native';
import axios from 'axios';

const fetchData = async () => {
    try {
        const response = await axios.get('http://localhost:3000/zivotinje');
        return response.data;
    } catch (error) {
        console.error('Error fetching data: ', error);
        return [];
    }
};

const ZivotinjeScreen = () => {
    const [zivotinje, setZivotinje] = useState([]);

    useEffect(() => {
        fetchData().then(data => setZivotinje(data));
    }, []);

    return (
        <View>
            <FlatList
                data={zivotinje}
                keyExtractor={(item, index) => `${index}`}
                renderItem={({ item }) => (
                    <Text>{`${item.naziv_zivotinje}, ${item.vrsta_zivotinje}`}</Text>
                )}
            />
        </View>
    );
};

export default ZivotinjeScreen;
